  return (
    <>
      <div className="cell-menu-row" onClick={setPopupShown}>
        <p>Change calculation</p>
      </div>
      <div className="cell-menu-row delete-row">
        <p>Delete</p>
      </div>

      <CalculationsMenu
        setPopupHidden={() => setPopupShown(false)}
        cell={cell}
        cellID={cellID}
      />
    </>
  );
}

export default CalculationsCellMenuContents;
